import React, { useState } from 'react';
import styled from 'styled-components';
import avatar from '../../img/avatar.png';
import { signout } from '../../utils/Icons';
import { menuItems } from '../../utils/menuItems';
import { useLogout } from '../../hooks/useLogout';
import { useAuthContext } from '../../context/AuthContext';
import { useNavigate } from 'react-router-dom';  
import { Link } from 'react-router-dom';


function Navigation({ active, setActive }) {

    const [showLogin, setShowLogin] = useState(false);
    const [showSignup, setShowSignup] = useState(false);
    const navigate = useNavigate(); 

    const { logout } = useLogout();
    const { user } = useAuthContext();
    
    const handleClick = () => {
        logout();
        navigate('/home');  // Redirect to '/home' after logout
    };

    const handleToggleLogin = () => {
        setShowLogin(!showLogin);
        setShowSignup(false);
    };

    const handleToggleSignup = () => {
        setShowSignup(!showSignup);
        setShowLogin(false);
    };

    return (
        <NavStyled>
            <nav>
                <div>
                    {!user && (
                        <>
                            <button className='login-btn' onClick={handleToggleLogin}>
                                {showLogin ? 'Close Login' : 'Login'}
                            </button>
                            <button className='signup-btn' onClick={handleToggleSignup}>
                                {showSignup ? 'Close Signup' : 'Signup'}
                            </button>
                        </>
                    )}
                </div>
            </nav>
            
            {showLogin || showSignup ? (
                <FormContainer>
                    {showLogin && <Login />}
                    {showSignup && <Signup />}
                </FormContainer>
            ) : null}

            <div className="user-con">
                <img src={avatar} alt="User Avatar" />
                <div className="text">
                    <h2>{user ? user.name : "Guest"}</h2>
                    <p>Your Money</p>
                </div>
            </div>

            <ul className="menu-items">
                {menuItems.map((item) => (
                    <li
                        key={item.id}
                        onClick={() => setActive(item.id)}
                        className={active === item.id ? 'active' : ''}
                    >
                        {item.icon}
                        <span>{item.title}</span>
                    </li>
                ))}
            </ul>

            {user && (
                <div className="bottom-nav">
                    <Link to="/home"></Link>
                    <span>{user.email}</span>
                    <button className='logout-btn' onClick={handleClick}>
                        {signout} Log Out
                    </button>
                </div>
            )}
        </NavStyled>
    );
}

const NavStyled = styled.nav`
    padding: 2rem 1.5rem;
    width: 374px;
    height: 100%;
    background: rgba(252, 246, 249, 0.78);
    border: 3px solid #FFFFFF;
    backdrop-filter: blur(4.5px);
    border-radius: 32px;
    display: flex;
    flex-direction: column;
    justify-content: space-between;
    gap: 2rem;

    .user-con {
        height: 100px;
        display: flex;
        align-items: center;
        gap: 1rem;

        img {
            width: 80px;
            height: 80px;
            border-radius: 50%;
            object-fit: cover;
            background: #fcf6f9;
            border: 2px solid #FFFFFF;
            padding: .2rem;
            box-shadow: 0px 1px 17px rgba(0, 0, 0, 0.06);
        }
        h2 {
            color: rgba(34, 34, 96, 1);
        }
        p {
            color: rgba(34, 34, 96, .6);
        }
    }

    .menu-items {
        flex: 1;
        display: flex;
        flex-direction: column;

        li {
            display: grid;
            grid-template-columns: 40px auto;
            align-items: center;
            margin: .6rem 0;
            font-weight: 500;
            cursor: pointer;
            transition: all .4s ease-in-out;
            color: rgba(34, 34, 96, .6);
            padding-left: 1rem;
            position: relative;

            i {
                color: rgba(34, 34, 96, 0.6);
                font-size: 1.4rem;
                transition: all .4s ease-in-out;
            }
        }
    }

    .active {
        color: rgba(34, 34, 96, 1) !important;

        i {
            color: rgba(34, 34, 96, 1) !important;
        }

        &::before {
            content: "";
            position: absolute;
            left: 0;
            top: 0;
            width: 4px;
            height: 100%;
            background: #222260;
            border-radius: 0 10px 10px 0;
        }
    }

    .login-btn, .signup-btn {
        padding: 10px;
        margin-right: 10px;
        background-color: var(--primary); /* Use a primary color */
        color: #fff;
        border-radius: 5px;
        cursor: pointer;
        font-size: 1rem;
    }

    .logout-btn {
        background: #fff;
        color: var(--primary);
        border: 2px solid var(--primary);
        padding: 6px 10px;
        border-radius: 4px;
        font-family: "Poppins";
        cursor: pointer;
        font-size: 1.5em;
    }
`;

const FormContainer = styled.div`
    display: flex;
    justify-content: center;
    align-items: center;
    flex-direction: column;
    width: 100%;
    margin-top: 1rem;
    background: rgba(255, 255, 255, 0.9);
    border-radius: 20px;
    padding: 2rem;
    box-shadow: 0px 1px 15px rgba(0, 0, 0, 0.1);
`;

export default Navigation;
